import './css/my_reset.css';
import './css/App.css';

import Header from './components/Header';
import MainListPage from './pages/MainListPage';
import LoginPage from './pages/LoginPage';
import RegisterPage from './pages/RegisterPage';

function App() {
  return (
    <div className="wrap">
      <Header />
      <Routes></Routes>
      <MainListPage />
      <LoginPage />
      <RegisterPage />
    </div>
  );
}

export default App;
